function to(text) {
  var coder = new TextEncoder();
  var data = coder.encode(text);
  var enData = btoa(String.fromCharCode.apply(null, data));
  return enData;
}

function from(text) {
  var coder = new TextDecoder();
  var deData = coder.decode(Uint8Array.from(atob(text), function (c) {
    return c.charCodeAt(0);
  }));
  return deData;
}
